import React, { useState } from 'react'
import './../App.css';
export default function Apiclass2() {
    const [name, setName] = useState(null);
    const [email, setEmail] = useState(null);
    const [phone, setPhone] = useState(null);
    function getFormData(e) {
        e.preventDefault()
        console.log({ 'name': name, 'email': email, 'phone': phone });
    }
    return (
        <div className="User">
            <h2>Api POST Method</h2>
            <form onSubmit={getFormData}>
                <input type="text" placeholder='Enter Name' onChange={(e) => setName(e.target.value)} /><br /><br />

                <input type="text" placeholder='Email Id' onChange={(e) => setEmail(e.target.value)} /><br /><br />

                <input type="number" placeholder='Enter Mobile No' onChange={(e) => setMobile(e.target.value)} /><br /><br />

                <button type="submit" >Submit</button>
            </form>
        </div >
    );
}
